import React from 'react';
import { Route, Switch } from 'react-router-dom';
import AddTrail from "../AddTrail/addTrail"
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';
import EditTrail from '../EditTrail/editTrail';
import TrailContainer from '../TrailContainer/trailContainer';


export default class Example extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>
            <switch>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">TrailBlazer</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/">Home</NavLink>
                <Route exact path="/" component={TrailContainer} />
              </NavItem>
              <NavItem>
                <NavLink href="/">LogIn</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Options
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Add a Trail
                  </DropdownItem>
                  <DropdownItem>
                    Edit a Trail
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
        </switch>
      </div>
    );
  }
}
